import React, { Component } from 'react'
import { Menu, Icon } from 'antd';

const { SubMenu } = Menu;
class AsiderNav extends Component {

    render() {
        return (
            <Menu mode="inline" theme='dark' style={{
                overflow: 'auto',
                height: '100vh',
                position: 'fixed',
                left: 0,
                width: 200,
            }}>
                <Menu.Item key="1">
                    <Icon type="home" />
                    <span>主页</span>
                </Menu.Item>

                <Menu.Item key="6">
                    <Icon type="setting" />
                    <span>设置</span>
                </Menu.Item>

                <SubMenu
                    key="sub3"
                    title={
                        <span>
                            <Icon type="user" />
                            <span>人员管理</span>
                        </span>
                    }
                >
                    <Menu.Item key="9">111</Menu.Item>
                    <Menu.Item key="10">222</Menu.Item>
                    <Menu.Item key="11">333</Menu.Item>
                    <Menu.Item key="12">444</Menu.Item>
                </SubMenu>
            </Menu>
        );
    }
}
export default AsiderNav
